import './Fashion.css';

import { Container } from "react-bootstrap";

function Fashion(){
    return(
        <Container fluid>
            <div className = "fashion-wrapper">
                <div className = "fashion-header">
                    <h1>Fashion</h1>
                    <h6>See all Fashion</h6>
                </div>
            </div>
        </Container>
    )
}

export default Fashion
